async function () {
  Receive_input.setValue("Please wait...");
  receive_messages.run().then(msgs => {
    if (!msgs || ("length" in msgs) && msgs.length <= 0) {
      Receive_input.setValue(" No messages received ");
      return;
    }
    const msgs_formatted = [];
    for (const m of msgs) {
      const newMsg = {};
      for (const key in m) {
        if (key === "Body") {
          newMsg[key] = JSON.parse(m[key]);
        } else {
          newMsg[key] = m[key];
        }
      }
      msgs_formatted.push(newMsg);
    }
    Receive_input.setValue(beautify_js.beautify(JSON.stringify(msgs_formatted)));
  }, r => {
    modal_input.setValue(r.message);
    showModal(Modal_error.name);
  });
}

